function shuffleImage(e){let n=e.id+"-index",o=sessionStorage.getItem(n);const s=JSON.parse(e.dataset.images);for(;!0;)if(index=Math.floor(Math.random()*s.length),index!=o)break;sessionStorage.setItem(n,index);const t=s[index];e.alt=t.alt,e.src=t.src,e.width=t.width,e.height=t.height}window.onload=function(){els=document.getElementsByClassName("random-image"),[...els].forEach(e=>{const t=JSON.parse(e.dataset.images);t.forEach(e=>{(new Image).src=e.src}),shuffleImage(e)})}